import com.eviware.soapui.model.testsuite.TestRunner.Status

// get TestCase
def tc = testRunner.testCase.testSuite.project.testSuites["TestSuite 1"].testCases["PropertyExpansion"]

//tc.run( null, false )


// set credential properties from the script itself
tc.testSteps["Properties"].setPropertyValue("sku", "SKU12346" )
tc.testSteps["Properties"].setPropertyValue("name","MPS Testing Groovy")
tc.testSteps["Properties"].setPropertyValue("attributeSetId","4")
tc.testSteps["Properties"].setPropertyValue("price","123456789")
tc.testSteps["Properties"].setPropertyValue("typeId","simple")

// run test synchrouously
def runner = tc.run( null, false )


// show the test case result status
log.info "Status: $runner.status, time taken for TestCase was: $runner.timeTaken ms"
log.info "Number of test steps which ran: " + runner.results.size()


// assert that it didn't fail
assert runner.status != Status.FAILED : runner.reason

// assert that only five steps ran!!
assert runner.results.size() == 9

import com.eviware.soapui.support.XmlHolder
def response=testRunner.testCase.getTestStepByName("NewProduct").getPropertyValue("response")
log.info response
def holder = new XmlHolder(response)
def sku=holder.getNodeValue("//result//sku")
log.info sku
testRunner.testCase.getTestStepByName("Properties").setPropertyValue("SKU",sku)
